import React from "react";

const TestimonialCard = ({ image, title, rating, description }) => {
  return (
    <div className="flex flex-col items-start bg-white shadow-md rounded-lg p-4">
      <div className="flex items-center gap-4 mb-2">
        <img
          src={image}
          alt={title}
          className="w-16 h-16 object-cover rounded-full"
        />
        <div>
          <span className="block font-semibold text-lg">{title}</span>
          <p className="text-yellow-500 font-bold">‚≠ê {rating}</p>
        </div>
      </div>
      <p className="text-gray-600">{description}</p>
    </div>
  );
};

export default TestimonialCard;
